import './App.css';

const formLog=()=> {
  return(
    <div>
  let login=(<form action="#" onSubmit={this.authorize}>
  <input 
    type="password" 
    placeholder="Password" />
  <input type="submit" />
  </form>);
  let contactInfo=(<ul>
        <li>
          client@example.com
        </li>
        <li>
          555.555.5555
        </li>
      </ul>);
</div>
      );
}

function App() {
  return (
    <div className="App">
        <p>
         Hello this is my first react application
        </p>
        <formLog />
    </div>
  );
}

export default App;
